import React,{Component} from 'react';


class Fetch extends Component {
  constructor(props){
    super(props);
  this.state={
data:[],
isLoaded: false,

  }

}
componentDidMount(){
  fetch('http://731a4a9d.ngrok.io/user/display')
  .then(res => res.json())
  .then(json => {
    this.setState({
      isLoaded:true,
      data:json,
    })

  });
  console.log(this.state.data)

}
  render() { 
    var { isLoaded,data}= this.state;
    if(!isLoaded){

      return <p>keep waiting </p>
    }
    else{
      return (  

        <div>
          <ul>
            {
              data.map(data=>(
                <li key={data.id}>
                  {data.id}
                  {data.firstName}
                  {data.lastName}
                  {data.mobileNo}
                  {data.email}
                  {data.place}
                  {data.designation}
                </li>
              ))
               }

          </ul> 
        </div>


        );

    }

  }
}

export default Fetch;
